    false,nt"url": null,nt"notes": "This airborne LiDAR terrain mapping data
    was acquired January through March 2001. The data were collected for the floodplain
    mapping program for the state of North Carolina. The data were collected for the
    state in three phases: 1, 2, and 3. This metadata record describes that data that
    were in phase 1 of collection and fall within the Neuse, Pasquotank, Tar-Pamlico,
    and White Oak River Basins in central and eastern North Carolina. This area consists
    of 33 counties which are listed below in the Place Keywords field. The data were
    received by the NOAA Coastal Services Center from the U.S. Geological Survey (USGS)
    Center for Lidar Coordination and Knowledge (CLICK). For data storage and Digital
    Coast provisioning purposes, the CSC converted the data to geographic coordinates
    and ellipsoid (Geoid99) elevations. The data are unclassified.",nt"license_title":
